import './cart.css'

const Cart = ()=>(
    <div class="cartdiv">
        <img alt="Cart IMG" src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.istockphoto.com%2Ffr%2Fphotos%2Fcaddie&psig=AOvVaw1UurB2gNZra_BJWreuv_Me&ust=1675774767449000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPjF7s_5gP0CFQAAAAAdAAAAABAF'></img>
    </div>
);
export default Cart
